import React from "react";

function Landingpage() {
  return (
    <>
      <meta charSet="utf-8" />
      <meta content="width=device-width, initial-scale=1" name="viewport" />
      <title>Railroad Cotton Exchange</title>
      <style
        dangerouslySetInnerHTML={{
          __html:
            "
   @font-face {
     font-family: 'Inter';
     font-style: normal;
     font-weight: 400;
     src: url('https://fonts.gstatic.com/s/inter/v12/UcCO3FwrK3iLTeHuS_fv.woff2') format('woff2');
   }
   @font-face {
     font-family: 'Inter';
     font-style: normal;
     font-weight: 600;
     src: url('https://fonts.gstatic.com/s/inter/v12/UcCO3FwrK3iLTeHuS_fv.woff2') format('woff2');
   }
   body {
     background-color: white;
     color: #1a202c;
     font-family: 'Inter', sans-serif;
     margin: 0;
   }
   header {
     border-bottom: 1px solid #d1d5db;
   }
   .container {
     max-width: 80rem;
     margin-left: auto;
     margin-right: auto;
     padding-left: 1rem;
     padding-right: 1rem;
   }
   .header-inner {
     display: flex;
     align-items: center;
     justify-content: space-between;
     height: 5rem;
   }
   .logo-section {
     display: flex;
     align-items: center;
     gap: 1rem;
     font-family: monospace;
     font-size: 1.25rem;
     font-weight: 600;
     line-height: 1;
     user-select: none;
   }
   .logo-section img {
     width: 3.5rem;
     height: 3.5rem;
     object-fit: contain;
   }
   nav.desktop-nav {
     display: none;
     gap: 2rem;
     font-size: 0.875rem;
     font-weight: 400;
     color: #4a5568;
   }
   nav.desktop-nav span {
     cursor: default;
   }
   nav.desktop-nav .active {
     color: #dc2626;
     font-weight: 600;
   }
   .account-desktop {
     display: none;
     align-items: center;
     gap: 1.5rem;
     color: #4a5568;
     font-size: 0.875rem;
   }
   .account-desktop button {
     display: flex;
     align-items: center;
     gap: 0.25rem;
     background: none;
     border: none;
     color: #dc2626;
     cursor: pointer;
     font-size: 0.875rem;
   }
   .account-desktop button i {
     color: #dc2626;
   }
   form.search-form {
     display: flex;
     flex-direction: column;
     gap: 0.75rem;
     max-width: 80rem;
     margin: 1.5rem auto 0 auto;
     padding-left: 1rem;
     padding-right: 1rem;
   }
   form.search-form select,
   form.search-form input {
     border: 1px solid #d1d5db;
     border-radius: 0.375rem;
     padding: 0.5rem 0.75rem;
     font-size: 0.875rem;
     width: 100%;
     outline: none;
     box-sizing: border-box;
   }
   form.search-form button {
     background-color: #dc2626;
     border-radius: 0.375rem;
     padding: 0.5rem;
     width: 100%;
     color: white;
     border: none;
     cursor: pointer;
     font-size: 0.875rem;
   }
   form.search-form button i {
     font-size: 0.875rem;
   }
   section.hero-banner {
     max-width: 80rem;
     margin: 1.5rem auto 0 auto;
     padding-left: 1rem;
     padding-right: 1rem;
   }
   .hero-inner {
     position: relative;
     border-radius: 0.5rem;
     overflow: hidden;
     max-height: 280px;
   }
   .hero-inner img {
     width: 100%;
     height: auto;
     object-fit: cover;
     border-radius: 0.5rem;
     max-height: 280px;
     display: block;
   }
   .hero-overlay {
     position: absolute;
     inset: 0;
     background-color: rgba(0,0,0,0.4);
     display: flex;
     flex-direction: column;
     justify-content: center;
     align-items: center;
     text-align: center;
     padding-left: 1rem;
     padding-right: 1rem;
     color: white;
   }
   .hero-overlay h2 {
     font-weight: 600;
     font-size: 1.125rem;
     line-height: 1.25;
     max-width: 48rem;
     margin: 0;
   }
   .hero-overlay button {
     margin-top: 0.75rem;
     background-color: #dc2626;
     border: none;
     color: white;
     font-size: 0.875rem;
     font-weight: 600;
     border-radius: 0.375rem;
     padding: 0.25rem 1rem;
     display: flex;
     align-items: center;
     gap: 0.25rem;
     cursor: pointer;
   }
   section.categories {
     max-width: 80rem;
     margin: 2.5rem auto 0 auto;
     padding-left: 1rem;
     padding-right: 1rem;
   }
   section.categories h3 {
     font-size: 1.125rem;
     font-weight: 600;
     margin-bottom: 1rem;
   }
   .categories-container {
     display: flex;
     flex-direction: column;
     gap: 1.5rem;
     justify-content: center;
   }
   .category-item {
     position: relative;
     border-radius: 0.5rem;
     overflow: hidden;
     width: 100%;
     max-width: 20rem;
     margin-left: auto;
     margin-right: auto;
   }
   .category-item img {
     width: 100%;
     height: auto;
     object-fit: cover;
     display: block;
   }
   .category-overlay {
     position: absolute;
     inset: 0;
     background-color: rgba(0,0,0,0.5);
     display: flex;
     justify-content: center;
     align-items: center;
     color: white;
     font-size: 0.875rem;
     font-weight: 600;
   }
   section.new-products {
     max-width: 80rem;
     margin: 2.5rem auto 0 auto;
     padding-left: 1rem;
     padding-right: 1rem;
   }
   section.new-products h3 {
     font-size: 1.125rem;
     font-weight: 600;
     margin-bottom: 1rem;
   }
   .products-container {
     display: flex;
     flex-direction: column;
     gap: 1.5rem;
   }
   .product-item {
     width: 100%;
     border: 1px solid #e5e7eb;
     border-radius: 0.375rem;
     padding: 0.5rem;
     box-sizing: border-box;
   }
   .product-image-wrapper {
     position: relative;
     border-radius: 0.375rem;
     overflow: hidden;
   }
   .product-image-wrapper img {
     width: 100%;
     height: auto;
     object-fit: cover;
     border-radius: 0.375rem;
     display: block;
   }
   .favorite-button {
     position: absolute;
     top: 0.5rem;
     right: 0.5rem;
     background: white;
     border-radius: 9999px;
     padding: 0.25rem;
     color: #4a5568;
     border: none;
     cursor: pointer;
     font-size: 0.875rem;
   }
   .product-info {
     display: flex;
     justify-content: space-between;
     align-items: center;
     margin-top: 0.5rem;
     font-size: 0.75rem;
     font-weight: 600;
     color: #1a202c;
   }
   .product-description {
     font-size: 0.75rem;
     color: #4a5568;
     margin-top: 0.25rem;
     margin-bottom: 0;
   }
   .product-rating {
     display: flex;
     align-items: center;
     gap: 0.25rem;
     margin-top: 0.25rem;
     color: #dc2626;
     font-size: 0.75rem;
   }
   .product-rating span {
     color: #a0aec0;
   }
   .view-product-button {
     margin-top: 0.5rem;
     font-size: 0.75rem;
     border: 1px solid #dc2626;
     color: #dc2626;
     border-radius: 9999px;
     padding: 0.25rem 0.75rem;
     background: none;
     cursor: pointer;
   }
   .explore-more-button {
     background-color: #dc2626;
     border: none;
     color: white;
     font-size: 0.875rem;
     font-weight: 600;
     border-radius: 0.375rem;
     padding: 0.5rem 1.5rem;
     display: flex;
     align-items: center;
     gap: 0.25rem;
     cursor: pointer;
     margin: 2rem auto 0 auto;
     justify-content: center;
   }
   section.subscribe {
     background-color: #b91c1c;
     margin-top: 4rem;
   }
   .subscribe-container {
     max-width: 80rem;
     margin-left: auto;
     margin-right: auto;
     padding-left: 1rem;
     padding-right: 1rem;
     padding-top: 2.5rem;
     padding-bottom: 2.5rem;
     display: flex;
     flex-direction: column;
     align-items: center;
     justify-content: space-between;
     gap: 1.5rem;
     color: white;
   }
   .subscribe-container h3 {
     font-size: 1.25rem;
     font-weight: 600;
     user-select: none;
     margin: 0;
   }
   .subscribe-container p {
     color: #fecaca;
     font-size: 0.75rem;
     max-width: 36rem;
     text-align: center;
     margin: 0;
   }
   .subscribe-form {
     display: flex;
     width: 100%;
     max-width: 24rem;
   }
   .subscribe-form input {
     border-top-left-radius: 0.375rem;
     border-bottom-left-radius: 0.375rem;
     padding: 0.5rem 0.75rem;
     font-size: 0.875rem;
     border: none;
     outline: none;
     flex-grow: 1;
   }
   .subscribe-form button {
     background-color: #7f1d1d;
     border-top-right-radius: 0.375rem;
     border-bottom-right-radius: 0.375rem;
     padding: 0.5rem 1rem;
     font-size: 0.875rem;
     font-weight: 600;
     color: white;
     border: none;
     cursor: pointer;
   }
   .subscribe-decor {
     position: relative;
     height: 3rem;
   }
   .subscribe-decor div {
     position: absolute;
     bottom: 0;
     width: 5rem;
     height: 3rem;
   }
   .subscribe-decor .block1 {
     left: 0;
     background-color: #991b1b;
   }
   .subscribe-decor .block2 {
     left: 5rem;
     background-color: #7f1d1d;
   }
   .subscribe-decor .block3 {
     left: 10rem;
     background-color: #991b1b;
   }
   footer {
     background-color: #1a202c;
     color: #d1d5db;
     font-size: 0.75rem;
     user-select: none;
   }
   .footer-inner {
     max-width: 80rem;
     margin-left: auto;
     margin-right: auto;
     padding-left: 1rem;
     padding-right: 1rem;
     padding-top: 2.5rem;
     padding-bottom: 2.5rem;
   }
   .footer-top {
     display: flex;
     flex-direction: column;
     gap: 3rem;
     justify-content: space-between;
     flex-wrap: wrap;
   }
   .footer-logo-section {
     display: flex;
     flex-direction: column;
     align-items: flex-start;
     gap: 1rem;
   }
   .footer-logo-section img {
     width: 3.5rem;
     height: 3.5rem;
     object-fit: contain;
   }
   .footer-social-icons {
     display: flex;
     gap: 1rem;
     font-size: 1rem;
     color: #a0aec0;
   }
   .footer-social-icons i {
     cursor: default;
   }
   .footer-links {
     display: flex;
     gap: 5rem;
     flex-wrap: wrap;
   }
   .footer-links h4 {
     font-weight: 600;
     color: white;
     margin-bottom: 0.75rem;
   }
   .footer-links ul {
     list-style: none;
     padding: 0;
     margin: 0;
     color: #a0aec0;
     line-height: 1.5;
   }
   .footer-links ul li {
     margin-bottom: 0.25rem;
   }
   .footer-contact li {
     display: flex;
     align-items: center;
     gap: 0.5rem;
   }
   .footer-bottom {
     margin-top: 2.5rem;
     text-align: center;
     color: #718096;
   }
   .footer-bottom p {
     margin: 0;
   }
   .footer-powered-by {
     display: inline-flex;
     align-items: center;
     gap: 0.25rem;
     font-weight: 600;
     color: #a0aec0;
     justify-content: center;
   }
   .footer-powered-by img {
     width: 1rem;
     height: 1rem;
     object-fit: contain;
   }
   /* Responsive */
   @media (min-width: 768px) {
     nav.desktop-nav {
       display: flex !important;
     }
     .account-desktop {
       display: flex !important;
     }
     form.search-form {
       flex-direction: row;
       gap: 0.75rem;
     }
     form.search-form select {
       width: 10rem !important;
     }
     form.search-form button {
       width: 3rem !important;
     }
     .categories-container {
       flex-direction: row !important;
       gap: 1.5rem !important;
     }
     .category-item {
       margin-left: 0 !important;
       margin-right: 0 !important;
       width: 33.3333% !important;
       max-width: 20rem !important;
     }
     .products-container {
       flex-direction: row !important;
       gap: 1.5rem !important;
     }
     .subscribe-container {
       flex-direction: row !important;
       align-items: flex-start !important;
       justify-content: space-between !important;
       gap: 0 !important;
     }
     .subscribe-container p {
       text-align: left !important;
       max-width: 36rem !important;
     }
     .footer-top {
       flex-direction: row !important;
     }
     .footer-powered-by {
       justify-content: flex-start !important;
     }
   }
  ",
        }}
      />
      <style
        dangerouslySetInnerHTML={{
          __html:
            '
   /* FontAwesome SVG fallback for icons */
   .fa-shopping-cart::before { content: "\f07a"; font-family: "Font Awesome 5 Free"; font-weight: 900; }
   .fa-user-circle::before { content: "\f2bd"; font-family: "Font Awesome 5 Free"; font-weight: 900; }
   .fa-search::before { content: "\f002"; font-family: "Font Awesome 5 Free"; font-weight: 900; }
   .fa-arrow-right::before { content: "\f061"; font-family: "Font Awesome 5 Free"; font-weight: 900; }
   .fa-heart::before { content: "\f004"; font-family: "Font Awesome 5 Free"; font-weight: 400; }
   .fa-star::before { content: "\f005"; font-family: "Font Awesome 5 Free"; font-weight: 900; }
   .fa-twitter::before { content: "\f099"; font-family: "Font Awesome 5 Brands"; }
   .fa-facebook-f::before { content: "\f39e"; font-family: "Font Awesome 5 Brands"; }
   .fa-instagram::before { content: "\f16d"; font-family: "Font Awesome 5 Brands"; }
   .fa-linkedin-in::before { content: "\f0e1"; font-family: "Font Awesome 5 Brands"; }
   .fa-envelope::before { content: "\f0e0"; font-family: "Font Awesome 5 Free"; font-weight: 400; }
   .fa-phone-alt::before { content: "\f879"; font-family: "Font Awesome 5 Free"; font-weight: 900; }
  ',
        }}
      />
      {/* Header */}
      <header>
        <div className="container">
          <div className="header-inner">
            <div className="logo-section">
              <img
                alt="Railroad Cotton Exchange logo black and white circular emblem with text"
                height={60}
                src="https://storage.googleapis.com/a1aa/image/1224f511-3c3c-4503-f2dc-93390f82d223.jpg"
                width={60}
              />
              <div>
                RAILROAD COTTON
                <br />
                EXCHANGE
              </div>
            </div>
            <nav className="desktop-nav" aria-label="Primary navigation">
              <span className="active">Home</span>
              <span>Shop</span>
              <span>Contact us</span>
              <span>About us</span>
            </nav>
            <div className="account-desktop" aria-label="User actions">
              <button aria-label="Cart">
                <i className="fas fa-shopping-cart" />
                <span>Cart</span>
              </button>
              <button aria-label="My Account">
                <i className="fas fa-user-circle" />
                <span>My Account</span>
              </button>
            </div>
          </div>
        </div>
      </header>
      {/* Search bar */}
      <form className="search-form" role="search" aria-label="Site search">
        <select aria-label="Select category">
          <option>All Categories</option>
        </select>
        <input
          placeholder="Search anything here"
          type="search"
          aria-label="Search input"
        />
        <button type="submit" aria-label="Search">
          <i className="fas fa-search" />
        </button>
      </form>
      {/* Hero banner */}
      <section className="hero-banner" aria-label="Promotional banner">
        <div className="hero-inner">
          <img
            alt="Colorful fabric rolls stacked vertically in rows with various patterns and colors"
            height={500}
            src="https://storage.googleapis.com/a1aa/image/8d57bee3-ee7e-4363-7e62-8ec80d6760af.jpg"
            width={1500}
          />
          <div className="hero-overlay">
            <h2>
              Revamp Your Interiors with Up to
              <br />
              65% Off on Fabrics!
            </h2>
            <button aria-label="Explore Products">
              <span>Explore Products</span>
              <i className="fas fa-arrow-right" />
            </button>
          </div>
        </div>
      </section>
      {/* Explore Our Categories */}
      <section className="categories" aria-label="Explore categories">
        <h3>Explore Our Categories</h3>
        <div className="categories-container">
          <div className="category-item">
            <img
              alt="Fabric category image with colorful fabric pieces on table"
              height={200}
              src="https://storage.googleapis.com/a1aa/image/51d20d1e-4ea5-4e45-45ac-35e28ac3497a.jpg"
              width={160}
            />
            <div className="category-overlay">Fabric</div>
          </div>
          <div className="category-item">
            <img
              alt="Patterns category image with pattern design tools and samples"
              height={200}
              src="https://storage.googleapis.com/a1aa/image/eeefb47e-186a-4de2-02ca-9913b5f3e9ba.jpg"
              width={160}
            />
            <div className="category-overlay">Patterns</div>
          </div>
          <div className="category-item">
            <img
              alt="Notions category image with sewing notions and tools"
              height={200}
              src="https://storage.googleapis.com/a1aa/image/58d067b9-82a9-47da-62fe-29a8773716e1.jpg"
              width={160}
            />
            <div className="category-overlay">Notions</div>
          </div>
        </div>
      </section>
      {/* New Products */}
      <section className="new-products" aria-label="New products">
        <h3>New Products</h3>
        <div className="products-container">
          <article className="product-item">
            <div className="product-image-wrapper">
              <img
                alt="Larkspur Shadow Play fabric pattern with red and blue stars and stripes"
                height={80}
                src="https://storage.googleapis.com/a1aa/image/026817e3-945a-4907-356a-9a79036c75c1.jpg"
                width={120}
              />
              <button aria-label="Favorite product" className="favorite-button">
                <i className="far fa-heart" />
              </button>
            </div>
            <div className="product-info">
              <h4>Larkspur Shadow Play</h4>
              <span>$11.99</span>
            </div>
            <p className="product-description">
              Lorem ipsum dolor sit amet, consectetur
            </p>
            <div className="product-rating" aria-label="Rating: 5 stars">
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <span>(20)</span>
            </div>
            <button className="view-product-button" aria-label="View Product">
              View Product
            </button>
          </article>
          <article className="product-item">
            <div className="product-image-wrapper">
              <img
                alt="Larkspur Shadow Play fabric pattern with red and blue stars and stripes"
                height={200}
                src="https://storage.googleapis.com/a1aa/image/026817e3-945a-4907-356a-9a79036c75c1.jpg"
                width={300}
              />
              <button aria-label="Favorite product" className="favorite-button">
                <i className="far fa-heart" />
              </button>
            </div>
            <div className="product-info">
              <h4>Larkspur Shadow Play</h4>
              <span>$11.99</span>
            </div>
            <p className="product-description">
              Lorem ipsum dolor sit amet, consectetur
            </p>
            <div className="product-rating" aria-label="Rating: 5 stars">
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <span>(20)</span>
            </div>
            <button className="view-product-button" aria-label="View Product">
              View Product
            </button>
          </article>
          <article className="product-item">
            <div className="product-image-wrapper">
              <img
                alt="Larkspur Shadow Play fabric pattern with red and blue stars and stripes"
                height={200}
                src="https://storage.googleapis.com/a1aa/image/026817e3-945a-4907-356a-9a79036c75c1.jpg"
                width={300}
              />
              <button aria-label="Favorite product" className="favorite-button">
                <i className="far fa-heart" />
              </button>
            </div>
            <div className="product-info">
              <h4>Larkspur Shadow Play</h4>
              <span>$11.99</span>
            </div>
            <p className="product-description">
              Lorem ipsum dolor sit amet, consectetur
            </p>
            <div className="product-rating" aria-label="Rating: 5 stars">
              <i className="fas fa-star" />
              <i className="fas fa-star" />
              <i className="fas fa-star" />
